  "text" : "そもそもほんとに女の子キャラクターの方がウケが良いのか、という疑問。多いってことは、それだけ支持されて好まれてきたってことともとれるけど、ほんとに大多数の支持があるんだったら、少なくとも営利目的なら、少しでもウケが良さそうな方を選ぶのは、そのシステム上は最適解になる？",
