  "text" : "まぁかわいいもかっこいいもよく分からんという自分にとっては、擬人化キャラクターが男でも女でも、受付係が若い女性であろうとおじいちゃんであろうと、役割とかしっかりしてるなら、その辺りどうでもいいんですけど。",
