  "geo" : {
  },
  "id_str" : "86157786303569920",
  "text" : "つまり、「ウケてほしい対象」が男性的だから、ということ？んー、まぁその辺りきちんと研究してる心理学者さんとかいるだろうと思うから、機会があったら読んでみよう。",
