  "id_str" : "84156337898012672",
  "text" : "特許4608598らしい。そして特許庁で検索してみたら、どうやら左下から流出するらしく、その分は右上から流入する仕組みですって。結論：ただの水力発電でした。 http://t.co/elY3Jwa [l]",
