  "id_str" : "84150831800258561",
  "text" : "「水位を保つために、ピンポン球の体積分の水が出し入れ」って部分がカギなのかもしれないけど、図からすると左下から水が流出してて、そうなるとただの位置水頭（エネルギー）の差を利用した水力発電にしかなってない。 http://t.co/elY3Jwa [l]",
