  "text" : "もし仮に水中への突入が慣性力によるものだとしても、表面張力を振り切って突入できるだけの慣性力を重力のみで得られる物質が、密度差だけで受ける浮力が働くとは思えない。 http://t.co/elY3Jwa [l]",
