  "id_str" : "83512614528884736",
  "text" : "まぁでも、差分においては、1次差分だと誤差大きすぎるし、かといって高次にすれば、計算負荷はともかく、敏感になりすぎて誤差を拡大させたり計算を不安定にさせるので、だいたい2次精度ぐらいが使われますよね。そういう意味で倍精度を選んでるなら納得できますけど。 [n]",
