  "text" : "最近、他にやることに追われてて（締切りが迫ってて）、ろくにやりたいこと＝研究＝具体的なコーディングがまっっっったくできてないので、非常につらいし面白くない。他のゲームとかマンガ読んだりってのでは満たされないこの楽しさ、改めて思い知った感じですね。 [n]",
