  "text" : "友人から「おれの嫁がかわいすぎて生きるのがつらい」とメール。うん、「なんだまたただのオタクか」と思ったあなた。残念ですが、ここの「嫁」は、彼の現実の嫁さんの話です。 [n]",
  "id" : 81376733894410240,
