  "text" : "個人的に言うと、jawpの検証可能性は非常に優れた方針だと思ってはいるものの、（こと工学系の）記事を書くときにめんどくさいのも事実なので、準専門家ぐらいな感じでなんとかできるウィキを作りたいなぁという野望があったりなかったり。 [n]",
