  "text" : "ウィキペディアからフォークした（あるいは類似している）ウィキはいくつかあって、古いところだと「ウィキペおたく」とか、最近だと（フォークって呼ぶべきじゃないかもしれませんが）「エンペディア」とかがいいと思います。ユアペディアはやめといたほうがいいです。 #jawp [n]",
