  "text" : "「同じ存在」には、人は惹かれる。「全く違う」存在には、人は寛大に接することができる。しかし、「似て非なる存在」には冷酷なまでに余地が無い。だからこそ、月の住人と地球の住人が一緒になれないのだ。 [n]",
