  "text" : "という話をすると「そりゃ分子原子レベルまで考えたら離散じゃないの」ということを言う人もいますが、じゃあその「分子原子間に働く力とかポテンシャルとかはどうなのか」という話には触れてないんですよね。あと空間だけではなくて時間についてはどうなのか。 [n]",
